from abc import ABC, abstractmethod

# An abstract base class that represents the interface for dynamic callable classes
class DynamicCallable(ABC):
  # An abstract method that handles positional arguments
  @abstractmethod
  def dynamicallyCall(withArguments: list) -> int:
    pass

  # An abstract method that handles named arguments
  @abstractmethod
  def dynamicallyCall(withKeywordArguments: dict) -> int:
    pass

# A subclass that inherits from the abstract base class and implements the abstract methods
@dynamicCallable # A decorator that marks the subclass as dynamic callable
class DynamicFeatures(DynamicCallable):
  # A method that handles positional arguments and returns their sum
  def dynamicallyCall(self, withArguments: list) -> int:
    # If there are no arguments, return 0
    if not withArguments:
      return 0
    # Otherwise, return the sum of the arguments
    return sum(withArguments)

  # A method that handles named arguments and returns the sum of the values with non-empty keys
  def dynamicallyCall(self, withKeywordArguments: dict) -> int:
    # If there are no arguments, return 0
    if not withKeywordArguments:
      return 0
    # Otherwise, return the sum of the values with non-empty keys
    return sum(value for key, value in withKeywordArguments.items() if key)

# Create an instance of the class
features = DynamicFeatures()
print(features()) # 0
print(features(3, 4, 5)) # 12
print(features(first=3, second=5)) # 8

