#include <stdio.h>
#include <stdlib.h>
#include <signal.h>
#include <unistd.h>
#include <sys/time.h>
#include <ucontext.h>

typedef struct tcb_t {
    ucontext_t context;
    char symbol;
    struct tcb_t *next;
    struct tcb_t *prev;
} task_t;

task_t *RunningTask;
task_t *TaskQueue;
int currentTask;

void symbolOutput(char symbol, int count) {
    for (int i = 0; i < count; i++)
        putchar(symbol);
    fflush(stdout);
}

void switchTask() {
    if (RunningTask == NULL)
        return;

    task_t *currentTask = RunningTask;
    RunningTask = RunningTask->next;

    if (RunningTask == NULL)
        RunningTask = TaskQueue;

    swapcontext(&currentTask->context, &RunningTask->context);
}

void signalHandler(int signum) {
    static int count = 0;

    if (count % 2 == 0) {
        symbolOutput(TaskQueue->symbol, 5);
        printf("\n");
    } else {
        symbolOutput(TaskQueue->next->symbol, 5);
        printf("\n");
    }

    count++;

    if (count % 2 == 0) {
        currentTask = (currentTask + 1) % 2;
        RunningTask = TaskQueue;

        for (int i = 0; i < currentTask; i++) {
            RunningTask = RunningTask->next;
        }

        switchTask();
    }
}

void *initlibrary() {
    RunningTask = NULL;
    TaskQueue = NULL;
    currentTask = 0;
}

void task1() {
    while (1) {
        if (RunningTask->symbol == TaskQueue->symbol) {
            symbolOutput(RunningTask->symbol, 5);
            printf("\n");
            switchTask();
        }
        usleep(1000000); // Sleep for 1 second
    }
}

void task2() {
    while (1) {
        if (RunningTask->symbol != TaskQueue->symbol) {
            symbolOutput(RunningTask->symbol, 5);
            printf("\n");
            switchTask();
        }
        usleep(1000000); // Sleep for 1 second
    }
}


int createTask(void (*start_routine)(), char symbol) {
    task_t *newTask = (task_t *) malloc(sizeof(task_t));
    if(newTask == NULL){
    	return -1;
    }
    getcontext(&newTask->context);
    newTask->context.uc_stack.ss_sp = malloc(SIGSTKSZ);
    newTask->context.uc_stack.ss_size = SIGSTKSZ;
    newTask->symbol = symbol;
    newTask->next = NULL;
    newTask->prev = NULL;
    makecontext(&newTask->context, start_routine, 0);

    if (TaskQueue == NULL) {
        TaskQueue = newTask;
        TaskQueue->next = TaskQueue;
        TaskQueue->prev = TaskQueue;
    } else {
        newTask->prev = TaskQueue->prev;
        newTask->next = TaskQueue;
        TaskQueue->prev->next = newTask;
        TaskQueue->prev = newTask;
    }
    return 0;
}

int main(int argc, char *argv[]) {
    if (argc < 3) {
        printf("Please provide two symbols as arguments.\n");
        return 1;
    }
    initlibrary();
    char symbol1 = argv[1][0];
    char symbol2 = argv[2][0];

    signal(SIGALRM, signalHandler);
    struct itimerval timer;
    timer.it_interval.tv_sec = 1;
    timer.it_interval.tv_usec = 0;
    timer.it_value.tv_sec = 1;
    timer.it_value.tv_usec = 0;
    setitimer(ITIMER_REAL, &timer, NULL);

    createTask(task1, symbol1);
    createTask(task2, symbol2);

    RunningTask = TaskQueue;

    switchTask(); // Initial task switch

    while (1)
        ;

    return 0;
}

